import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // (optional, if you have this file)

function App() {
  return <h1>Hello, Job Portal!</h1>;
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
